import React from 'react';
import ReactDOM from 'react-dom/client';
import './style.css';
import Heading from './App';  // Presupunem că componentul principal se numește `App`
import reportWebVitals from './reportWebVitals';

// Asigură-te că fișierul HTML are un element cu ID-ul 'root'
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// Dacă folosești ID-ul `Header`, asigură-te că acesta există în HTML:
// <div id="Header"></div>
// Atunci, poți folosi `document.getElementById('Header')`.


reportWebVitals(console.log);
